// };

async function App() {
  const [ipData, setIpData] = useState({});
  // let myBard = new Bard(
  //   "aQhv2jeM_kHWdSY4mv17GY6gPzVLyomd5h24rTqHXST0xkT_P3Bda-I6fuRsQkN-QQQy4Q."
  // );

  // console.log(await myBard.ask("Hello, world!"));

  useEffect(() => {
    fetchData();
  }, []);

  const fetchData = async () => {
    const response = await FraudIp();
    console.log("response ", response);
    setIpData(response);
  };

  return (
    <div>
      <header className="header">
        <h1>Fraud Guard</h1>
      </header>
      <div className="cards-list-wrapper">
        {Object.entries(ipData).map((data, i) => (
          <DisplayIpData key={i} data={data[1]} ip={data[0]} />
        ))}
      </div>
    </div>
  );
}

export default App;
